const initializeContentScript = (injectionContext, s2kGuid, extensionId, lowQualityAction) => {
    getState().initialize(injectionContext, s2kGuid, extensionId, lowQualityAction);
    injectBasicCSS(extensionId);
};

/**
 * Inject basic css to current page
 */
const injectBasicCSS = (extensionId) => {
    let cssRotate = `
      @keyframes rotate360 {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
    `;
    let cssFont = `
        @font-face {
            font-family: 'Amazon Ember';
            src: url("_EXTURL_/fonts/AmazonEmber_Rg.ttf");
            font-weight: normal;
            font-style: normal;
            font-display: swap; 
        }
        @font-face {
            font-family: 'Amazon Ember';
            src: url("_EXTURL_/fonts/AmazonEmber_Bd.ttf");
            font-weight: bold;
            font-style: normal;
        }
    `;
    // Inject animation and Font
    const styleElement = document.createElement('style');
    let extensionUrl = `chrome-extension://${extensionId}`;
    cssFont = cssFont.replaceAll("_EXTURL_", extensionUrl);
    // Add styles into head of current page
    styleElement.textContent = cssRotate + cssFont;
    window.document.head.append(styleElement);
};


