    // If the reason is timeout, rating is -2, otherwise rating is -1
    let rating = isTimeout ? -2 : -1;
    let metricsName = isTimeout ? MetricsNames["extract-timeout"] : MetricsNames["extract-error"];

    // Record Url and Domain
    chrome.runtime.sendMessage({
        action: "report-low-rating",
        data: {
            rating: rating,
            url: state.stateDocument.URL || ""
        }
    });
