const redirectToPreview = function () {
    // Prevent from unload page
    addUnloadListener(preventFromUnload);
    const state = getState();
    if (state && state.content) {
        // show preview in progress alert
        state.statusMessage.showAlert("progress", "loadingPreview");

        // Request the browser to open the preview.
        chrome.runtime.sendMessage(
            {
                action: "store-content",
                data: {
                    "content": state.content.asStorageJson()
                }
            }, function (response) {
                // Stop monitoring unload action
                removeUnloadListener(preventFromUnload);
                // Redirect to preview.
                let previewUrl = response.url + "&isSelection=" + (state.isSelectedOnly ? "true" : "false");
                window.location.assign(previewUrl);
            });
    }
};

